var ComponentsBootstrapTouchSpin = function () {
    var t = function () {
        $("#touchspin_vi").TouchSpin({
            initval: 1,
            postfix: 'bản'

        }),
            $("#touchspin_en").TouchSpin({
                initval: 0,
                postfix: 'bản'
            })
    };
    return {
        init: function () {
            t()
        }
    }
}();
jQuery(document).ready(function () {
    ComponentsBootstrapTouchSpin.init()
});